Barbie presenteert het klassieke sprookje van Duimelijntje in een eigentijds jasje. Maak kennis met het piepkleine meisje Duimelijntje. Ze leeft in harmonie met de natuur in de magische wereld van de Twillerbees, een verborgen paradijs vol wilde bloemenpracht. Maar de door en door verwende Makena heeft haar zinnen gezet op juist dit stukje wilde natuur en voor ze het beseffen, bevinden Duimelijntje en haar twee vriendjes zich in een luxueuze flat in de grote stad. Tot hun ontzetting raken ze op de hoogte van bouwplannen die het land van de Twillerbees zullen vernietigen! Daar besluit Duimelijntje met haar magische natuurkrachten een stokje voor te steken en te bewijzen dat zelfs de kleinste persoon een groot verschil kan maken.



